public struct TimeframeFfi {
    public var annual: String
    public var monthly: String
    public var biWeekly: String
    public var weekly: String
    public var daily: String
    public var hourly: String

    // Default memberwise initializers are never public by default, so we
    // declare one manually.
    public init(annual: String, monthly: String, biWeekly: String, weekly: String, daily: String, hourly: String) {
        self.annual = annual
        self.monthly = monthly
        self.biWeekly = biWeekly
        self.weekly = weekly
        self.daily = daily
        self.hourly = hourly
    }
}



extension TimeframeFfi: Equatable, Hashable {
    public static func ==(lhs: TimeframeFfi, rhs: TimeframeFfi) -> Bool {
        if lhs.annual != rhs.annual {
            return false
        }
        if lhs.monthly != rhs.monthly {
            return false
        }
        if lhs.biWeekly != rhs.biWeekly {
            return false
        }
        if lhs.weekly != rhs.weekly {
            return false
        }
        if lhs.daily != rhs.daily {
            return false
        }
        if lhs.hourly != rhs.hourly {
            return false
        }
        return true
    }

    public func hash(into hasher: inout Hasher) {
        hasher.combine(annual)
        hasher.combine(monthly)
        hasher.combine(biWeekly)
        hasher.combine(weekly)
        hasher.combine(daily)
        hasher.combine(hourly)
    }
}


