            message: try FfiConverterString.read(from: &buf)
        )
        
        case 2: return .InvalidFilingStatus(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 3: return .InvalidState(
            message: try FfiConverterString.read(from: &buf)
        )
        
        case 4: return .CalculationError(
            message: try FfiConverterString.read(from: &buf)
        )
        

        default: throw UniffiInternalError.unexpectedEnumCase
        }
    }

    public static func write(_ value: TaxCalcError, into buf: inout [UInt8]) {
        switch value {

        

        
        case .InvalidDecimal(_ /* message is ignored*/):
            writeInt(&buf, Int32(1))
        case .InvalidFilingStatus(_ /* message is ignored*/):
            writeInt(&buf, Int32(2))
        case .InvalidState(_ /* message is ignored*/):
            writeInt(&buf, Int32(3))
        case .CalculationError(_ /* message is ignored*/):
            writeInt(&buf, Int32(4))

        
        }
    }
}


